import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Nav from './component/Nav';
import Shop from './component/Shop';
import Cart from './component/Cart';
import Checked from './component/checked/Checked';
import {ContextProvider} from "./component/Context"
import Letter from './component/letter/Letter';
import Makeups from './component/Makeups';
import Medicine from './component/Medicine';
import LeftNav from './component/leftNav/LeftNav'
import Language from "./component/language/Language"
import EnglishShop from './component/english/EnglishShop';

function App() {

  return (

    <div className="App">
    <ContextProvider>
    <BrowserRouter>
    <Language/>
    <Letter/>
      <Nav />
      <LeftNav/>
        <Routes>
          <Route path="/" element={<Shop/>}/>
          <Route path="/cart" element={<Cart/>}/>
          <Route path="/checked" element={<Checked/>}/>
          <Route path="/makeups" element={<Makeups/>}/>
          <Route path="/medicine" element={<Medicine/>}/>
          <Route path="/english" element={<EnglishShop/>}/>
        </Routes>
        </BrowserRouter>
        </ContextProvider>
    </div>

  );
}

export default App;
